import React from "react";
import FisicalPerson from "./screens/login/createFisicalPerson/FisicalPerson";
import { Provider } from "react-redux";
import store from "./store";

function App() {
  return (
    <Provider store={store}>
      <div>
        <FisicalPerson />
        <p>&#9776;</p>
      </div>
    </Provider>
  );
}

export default App;
